export const clipPathCombo = ({
  selector,
  duration,
  startingPosition,
  endingPosition,
  delay = 0,
  easing = "linear",
}: {
  selector: string;
  duration: string | number;
  startingPosition: number;
  endingPosition: number;
  delay?: string | number;
  easing?: string;
}) => {
  return new Combo(
    {
      incidents: [
        {
          incidentClass: CSSEffect,
          attrs: {
            animatedAttrs: {
              clipPath: endingPath,
            },
            initalValues: {
              clipPath: initialPath,
            },
          },
          props: {
            duration,
            easing,
          },
          position: startingPosition,
        },
        {
          incidentClass: CSSEffect,
          attrs: {
            animatedAttrs: {
              clipPath: initialPath,
            },
            initalValues: {
              clipPath: endingPath,
            },
          },
          props: {
            duration,
            easing,
          },
          position: endingPosition,
        },
      ],
    },
    {
      selector,
      delay,
      easing,
    },
  );
};

