export const mask = ({
  selector,
  from,
  to,
  duration,
  delay = 0,
  easing = "linear",
}: {
  selector: string;
  from: string;
  to: string;
  duration: string | number;
  delay?: string | number;
  easing?: string;
}) => {
  return new CSSEffect(
    {
      animatedAttrs: {
        maskImage: to,
      },
      initialValues: {
        maskImage: from,
      },
    },
    {
      selector,
      duration,
      delay,
      easing,
    },
  );
};

